class ProductCategoryViewComponent {
    constructor(authService, router, activatedRoute) {
        this.authService = authService;
        this.router = router;
        this.activatedRoute = activatedRoute;
        this.categoryId = '';
        this.productList = [];
        this.categoryName = '';
        this.categories = [];
        this.showLocationDropdown = false;
        this.router.routeReuseStrategy.shouldReuseRoute = () => false;
    }
    ngOnInit() {
        this.getCategories();
        this.categoryId = this.activatedRoute.snapshot.paramMap.get('id');
        if (this.categoryId) {
            this.getProducts();
            this.getCategory();
        }
        else {
            this.router.navigate(['']);
        }
    }
    getCategory() {
        this.authService.getOneCategory(this.categoryId).subscribe((res) => {
            this.categoryName = res.data.categoryName;
            if (this.categoryName === 'Food and Beverages') {
                this.showLocationDropdown = true;
            }
            else {
                this.showLocationDropdown = false;
            }
        });
    }
    getProducts() {
        let obj = {
            skip: 0,
            limit: 20,
            categoryId: this.categoryId
        };
        this.authService.getProductsByCategory(obj).subscribe((res) => {
            if (res.code === 200) {
                this.productList = res.data;
            }
        });
    }
    sortData(event) {
        console.log(event);
        let obj = {
            key: event.target.value ? event.target.value.split('-')[0] : "",
            sortBy: event.target.value ? (event.target.value.split('-')[1] === 'asc' ? "1" : "-1") : 0,
            skip: 0,
            limit: 100
        };
        this.authService.getSortProducts(obj).subscribe((res) => {
            if (res.code === 200) {
                this.productList = res.data;
            }
        });
    }
    getCategories() {
        let reqBody = {
            skip: 0,
            limit: 100
        };
        this.authService.getCategories(reqBody).subscribe(data => {
            this.categories = data['data'];
        }, error => {
            console.log(error);
        });
    }
    getProductByCity(event) {
        let reqBody = {
            skip: 0,
            limit: 100,
            city: event.target.value
        };
        this.authService.getProductsByCity(reqBody).subscribe(data => {
            this.productList = data['data'];
        }, error => {
            console.log(error);
        });
    }
}
